import {BrowserRouter as Router,Route,Switch } from "react-router-dom";
import Home from "./Pages/Home";



function App() {
  return (
    <div>
      <Router>
          <div>
              <Switch>
                  <Route path="/"> <Home/> </Route>
              </Switch>
          </div>
      </Router>
  
    </div>
  );
}

export default App;
